        div className = "container" >
        Approval { " " } <
        div className = "toggle-switch" >
        <
        input type = "checkbox"
        className = "checkbox"
        name = "Approval"
        id = "Approval" / >
        <
        label className = "label"
        htmlFor = "Approval" >
        <
        span className = "inner" / >
        <
        span className = "switch" / >
        <
        /label> < /
        div > <
        /div>
    );
};

export default ToggleSwitch;
